/*Table structure for table `schedules` */

DROP TABLE IF EXISTS `schedules`;

CREATE TABLE `schedules` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `account_id` int(11) NOT NULL DEFAULT '0' COMMENT '担当者アカウントID',
  `region_id` int(11) NOT NULL DEFAULT '0' COMMENT 'リージョンID',
  `district_id` varchar(4) NOT NULL DEFAULT '' COMMENT 'ディストリクトID',
  `facility_id` int(11) NOT NULL DEFAULT '0' COMMENT '施設ID',
  `role_code` int(1) NOT NULL DEFAULT '0',
  `title` varchar(60) DEFAULT NULL,
  `visit_schedule` date NOT NULL COMMENT '訪問日',
  `visit_time_from` int(4) unsigned zerofill NOT NULL DEFAULT '0000' COMMENT '訪問開始時刻',
  `visit_time_to` int(4) unsigned zerofill NOT NULL DEFAULT '0000' COMMENT '訪問終了時刻',
  `visit_to` varchar(10) DEFAULT '' COMMENT '訪問先',
  `visit_type` varchar(40) DEFAULT NULL,
  `visit_valid_type` int(1) DEFAULT NULL,
  `sales_type` varchar(10) DEFAULT NULL COMMENT '営業内容',
  `report_type` int(1) NOT NULL DEFAULT '0' COMMENT 'レポートする内容',
  `report_date` date DEFAULT NULL,
  `navx_report_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'NavX_Report_ID',
  `case_name` int(2) NOT NULL DEFAULT '0' COMMENT '症例名',
  `capital` int(1) NOT NULL DEFAULT '0' COMMENT 'キャピタル',
  `witness_content` int(2) NOT NULL DEFAULT '0' COMMENT '立会内容',
  `visit_comment` text,
  `ope_support_remarks` text COMMENT 'オペ立会いフリーコメント',
  `remarks` text COMMENT '備考',
  `accuracy` int(1) NOT NULL DEFAULT '0' COMMENT '確度コード',
  `sales_status` int(1) NOT NULL DEFAULT '0' COMMENT '営業ステータス',
  `status_report` int(1) NOT NULL DEFAULT '0' COMMENT '状況報告',
  `active` int(1) NOT NULL DEFAULT '1' COMMENT '有効コード',
  PRIMARY KEY (`id`)
